    <style>
      body {
        margin: 0;
      }
      #content-info {
        width: auto;
        margin: 0 auto;
        text-align: center;
      }
      #author-info {
        white-space: nowrap;
        text-overflow: ellipsis;
        overflow: hidden;
      }
      #title {
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
        padding-top: 10px;
        margin-bottom: 2px;
        font-size: 34px;
        color: #505050;
      }
      .text {
        white-space: nowrap;
        text-overflow: ellipsis;
        display: inline-block;
        margin-right: 20px;
        margin-bottom: 2px;
        font-size: 20px;
        color: #8c8c8c;
      }
      #navBar {
        position: fixed;
        right: 0;
        bottom: 0;
        background-color: #f0f3f4;
        overflow-y: auto;
        text-align: center;
      }
      #svg-container {
        width: 100%;
        min-width: 0;
        margin: 0 10px;
      }
      #nav-thumbs {
        padding: 0 5px;
      }
      .nav-thumb {
        position: relative;
        margin: 10px auto;
      }
      .nav-thumb > p {
        text-align: center;
        font-size: 12px;
        margin: 4px 0 0 0;
      }
      .nav-thumb > div {
        position: relative;
        display: inline-block;
        border: 1px solid #c6cfd5;
      }
      .nav-thumb img {
        display: block;
      }
      .nav-thumb span {
        pointer-events: none;
      }
      #main-content {
        bottom: 0;
        left: 0;
        right: 0;
        background-color: #d0cfd8;
        display: flex;
        height: auto;
        flex-flow: row wrap;
        text-align: center;
      }
      #svg-container > svg {
        display: block;
        margin: 10px auto;
        margin-bottom: 0;
      }
      #copyright {
        bottom: 0;
        left: 50%;
        margin: 5px auto;
        font-size: 16px;
        color: #515151;
      }
      #copyright > a {
        text-decoration: none;
        color: #77c;
      }
      .number {
        position: absolute;
        top: 0;
        left: 0;
        border-top: 22px solid #76838f;
        border-right: 22px solid transparent;
      }
      .pagenum {
        font-size: 12px;
        color: #fff;
        position: absolute;
        top: -23px;
        left: 2px;
      }
      #navBar::-webkit-scrollbar {
        width: 8px;
        background-color: #f5f5f5;
      }
      #navBar::-webkit-scrollbar-track {
        -webkit-box-shadow: inset 0 0 4px rgba(0, 0, 0, 0.3);
        border-radius: 8px;
        background-color: #fff;
      }
      #navBar::-webkit-scrollbar-thumb {
        border-radius: 8px;
        -webkit-box-shadow: inset 0 0 4px rgba(0, 0, 0, 0.3);
        background-color: #6b6b70;
      }
      #navBar::-webkit-scrollbar-thumb:hover {
        background-color: #4a4a4f;
      }
      .nav-thumb > div:hover {
        box-shadow: 1px 1px 4px rgba(0, 0, 0, 0.4);
      }
      .selected .number {
        border-color: #08a1ef transparent;
      }
    </style>

    <script>
      const svgs = document.getElementById("svg-container").children;
      const UA = window.navigator.userAgent;
      const ua = UA.indexOf("rv:11") + UA.indexOf("Firefox") >= 0;
      const svgcount =
        document.getElementById("svg-container").childElementCount;
      var styleArr = [];
      var heightArr = [];
      var navBar = document.getElementById("navBar");
      var conInfo = document.getElementById("content-info");
      for (var i = 0; i < svgcount; i++) {
        styleArr[i] = {
          width: svgs[i].getAttribute("width"),
          height: svgs[i].getAttribute("height"),
        };
      }
      window.onresize = function () {
        renavstyle();
        resvgstyle();
      };
      window.onscroll = renavstyle;
      window.onload = function () {
        renavstyle();
        var sideWidth = navBar.offsetWidth;
        document.getElementById("content-info").style.marginRight =
          sideWidth + "px";
        document.getElementById("main-content").style.marginRight =
          sideWidth + "px";
        resvgstyle();
        doscroll();
      };
      function recontainstyle() {
        var topHeight = conInfo.clientHeight;
        var svgHeight = 0;
        for (var i = 0; i < svgcount; i++) {
          heightArr[i] = svgs[i].getBoundingClientRect().height + 10;
          svgHeight +=
            svgs[i].clientHeight || svgs[i].getBoundingClientRect().height;
        }
        var fullHeight = svgHeight + Number(topHeight);
        if (fullHeight < window.innerHeight) {
          document.getElementById("copyright").style.position = "absolute";
          document.getElementById("copyright").style.transform =
            "translateX(-50%)";
          document.getElementById("main-content").style.position = "absolute";
          document.getElementById("main-content").style.top = topHeight + "px";
        } else {
          document.getElementById("copyright").style.position = "";
          document.getElementById("copyright").style.transform = "";
          document.getElementById("main-content").style.position = "";
        }
      }
      function resvgstyle() {
        var sideWidth = navBar.offsetWidth + 20;
        for (var i = 0; i < svgcount; i++) {
          var oriWidth = styleArr[i].width;
          var oriHeight = styleArr[i].height;
          var percent = oriHeight / oriWidth;
          var innerWidth = document.body.offsetWidth - sideWidth;
          if (innerWidth <= oriWidth) {
            svgs[i].removeAttribute("width");
            svgs[i].removeAttribute("height");
            if (ua) {
              svgs[i].setAttribute("height", innerWidth * percent);
            }
          } else {
            svgs[i].setAttribute("width", oriWidth);
            svgs[i].setAttribute("height", oriHeight);
          }
        }
        recontainstyle();
      }
      function renavstyle() {
        var topHeight = conInfo.clientHeight;
        var scrollTop =
          document.body.scrollTop || document.documentElement.scrollTop;
        if (scrollTop > topHeight) {
          document.getElementById("navBar").style.top = 0 + "px";
        } else {
          document.getElementById("navBar").style.top =
            topHeight - scrollTop + "px";
        }
        doscroll();
      }
      function doscroll() {
        var topHeight = conInfo.clientHeight;
        var scrollTop =
          document.body.scrollTop || document.documentElement.scrollTop;
        for (var i = 0; i < svgcount; i++) {
          var sum = 0;
          for (var j = 0; j <= i; j++) {
            sum += heightArr[j];
          }
          if (scrollTop + window.innerHeight / 2 - topHeight - sum < 0) {
            var sub = Number(i) + 1;
            if (document.querySelector("#nav-thumbs .selected")) {
              document
                .querySelector("#nav-thumbs .selected")
                .classList.remove("selected");
            }
            if (document.querySelector(".nav-thumb:nth-of-type(" + sub + ")")) {
              document
                .querySelector(".nav-thumb:nth-of-type(" + sub + ")")
                .classList.add("selected");
            }
            break;
          }
        }
      }
      var navs = document.querySelectorAll(".nav-thumb");
      for (i = 0; i < navs.length; i++) {
        navs[i].children[0].onclick = function () {
          document
            .querySelector("#nav-thumbs .selected")
            .classList.remove("selected");
          this.parentNode.classList.add("selected");
        };
      }
    </script>
